import './App.css';
import WeatherTile from './WeatherTile'

function App() {
  fetch('http://api.weatherapi.com/v1/forecast.json?key=6018bc6ca5bb4a4884c184418202812&q=Winnipeg&days=5')
  .then(response => response.json())
  .then(json => {
    const weatherData = json.forecast.forecastday
    //console.log(weatherData)
    const w1 = weatherData.map(data => {
      console.log(data.date)
      return <WeatherTile main={data.date} />
    })
    //console.log(w1)
    })
  return (
    <div className="App">
    {w1}
    </div>
  );
}

export default App;
